css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain(deviantart.com) {
.avatar{filter:alpha(opacity=95) !important;
-moz-opacity:.95 !important;}
.tt-a img,.shadow img,.avatar {
background-color: #a7c0b2 !important;
-moz-border-radius-topright: 2px !important;
-moz-border-radius-bottomright: 2px !important;
-moz-border-radius-topleft: 2px !important;
-moz-border-radius-bottomleft: 2px !important;
padding: 2px !important;}
.box,.thought{
background-color: #dfece3 !important;
-moz-border-radius-topright: 7px !important;
-moz-border-radius-bottomright: 7px !important;
-moz-border-radius-topleft: 7px !important;
-moz-border-radius-bottomleft: 7px !important;}
a.h{
color:#888 !important;
text-decoration: none !important;
font-size: 9px !important;
}

.thought.block.collapsed-thought{
display: none !important;
}

.f.a{
background-color: #d1dcd4 !important;
}

h,h1,h2,body{
     font-family: Segoe ui, tahoma, helvetica, sans-serif  !important;
}

div.iconset-deviant-boxtop i, div.boxtop i.icon {background-image:url(data:image/png;base64,%3D) !important;}

.boxtop{background-color: #c5cfc8 !important;}
.box, .boxtop, .thought, .alink.nav{border-color: #c5cfc8 !important;}
.deviant.bubbleview.h a, .box a, .boxtop a,.alink.nav a, .thought a{color: #525753 !important; text-decoration: none !important;}
.icon {padding: 0px 10px 0px 0px !important;}
}
